import React from 'react';
import logo from '../logo.jpg';

function Navbar() {
    return (
<nav className="navbar navbar-expand-lg navbar-light bg-light">
  <a className="navbar-brand" href="#">
  <img src={logo} alt="logo" />
  </a>

  <div className="collapse navbar-collapse" id="navbarSupportedContent">
    <ul className="navbar-nav mr-auto">
      <li className="nav-item active">
        <a className="nav-link text-black text-uppercase ml-5" href="#">Klimatförändringar <span className="sr-only">(current)</span></a>
      </li>
      <li className="nav-item">
        <a className="nav-link text-black text-uppercase ml-5" href="#">Ordlista</a>
      </li>
      <li className="nav-item">
        <a className="nav-link text-black text-uppercase ml-5" href="#">Om oss</a>
      </li>
    </ul>
  </div>
</nav>
    );
}

export default Navbar;
